import React from 'react';

const HomePage = () => {
  return (
    <div className="home-page">
      <section id="about" className="section">
        <h2>Hakkımızda</h2>
        <p>
          Burada CRM sistemi hakkında bilgiler yer alacak. Sistemimizin amacı, kullanıcılarımıza daha
          iyi hizmet sunmak için tasarlanmıştır. Bizimle ilgili daha fazla bilgi almak için lütfen
          iletişime geçin.
        </p>
      </section>

      <section id="contact" className="section">
        <h2>İletişim</h2>
        <p>
          Bize ulaşmak için aşağıdaki bilgilerden faydalanabilirsiniz:
        </p>
        <ul>
          <li>Telefon: 123-456-7890</li>
          <li>Email: crm@support.com</li>
        </ul>
      </section>
    </div>
  );
};

export default HomePage;
